  return (
    <div style={{ padding: '20px' }}>
      <h2>üìù Task List</h2>
      <ul>
        {tasks.map(task => (
          <li key={task.id}>
            {task.title} {task.completed ? "‚úÖ" : "‚ùå"}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default TaskList;
